function List() {
    return (
        <main>
            <ul className='status'>
                <li className='status__entry'>All</li>
                <li className='status__entry'>In Progress</li>
                <li className='status__entry'>Complete</li>
            </ul>
            <ul className='tasks'>
                <li className='tasks-'></li>
            </ul>
        </main>
    );
}

export default List;
